s = ''
t = ''

s_list = []
t_list = []
mismatch_count = 0

for character in s:
    s_list += character
for character in t:
    t_list += character

for number in range(len(s_list)):
    if s_list[number] != t_list[number]:
        mismatch_count += 1
    else:
        continue

print(mismatch_count)
